SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET AUTOCOMMIT = 0;
START TRANSACTION;
SET time_zone = "+00:00";



CREATE TABLE `audit_trail` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `audit_action` varchar(455) NOT NULL DEFAULT '',
  `audit_date` varchar(105) NOT NULL DEFAULT '',
  `audit_user` varchar(105) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13473 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `cart` (
  `cart_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `location_name` varchar(15) NOT NULL,
  `location_type` varchar(15) NOT NULL,
  `location_status` varchar(10) NOT NULL,
  PRIMARY KEY (`cart_id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `category` (
  `category_id` int(4) unsigned NOT NULL AUTO_INCREMENT,
  `category_name` varchar(25) NOT NULL,
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `customer` (
  `customer_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `customer_name` varchar(45) NOT NULL,
  `customer_contactno` varchar(45) NOT NULL,
  `customer_address` varchar(100) NOT NULL,
  PRIMARY KEY (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `dbase` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `database_name` varchar(105) NOT NULL DEFAULT '',
  `database_date` varchar(105) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `picking_order` (
  `slip_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `slip_no` varchar(20) NOT NULL,
  `slip_order_date` date NOT NULL,
  `bill_to` varchar(100) NOT NULL,
  `ship_to` varchar(100) NOT NULL,
  `reference` varchar(100) NOT NULL,
  `po_no` varchar(45) NOT NULL,
  `customer_address` varchar(255) NOT NULL,
  `sales_person` varchar(45) NOT NULL,
  `truck_id` varchar(15) NOT NULL,
  `ship_date` date NOT NULL,
  `comments` varchar(105) NOT NULL,
  `remarks` varchar(105) NOT NULL,
  `approved_by` int(10) unsigned NOT NULL,
  `invoice_billed_by` int(10) unsigned NOT NULL,
  `invoice_no` varchar(45) NOT NULL,
  `order_status` varchar(15) NOT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `do_no` varchar(45) NOT NULL DEFAULT '',
  `tracking_status` varchar(45) NOT NULL DEFAULT '',
  `assign_to` varchar(45) NOT NULL DEFAULT '',
  `time_delivered` timestamp NULL DEFAULT NULL,
  `received_by` varchar(45) DEFAULT NULL,
  `deliver_img` text DEFAULT NULL,
  `delivery_location` text DEFAULT NULL,
  PRIMARY KEY (`slip_id`)
) ENGINE=InnoDB AUTO_INCREMENT=181 DEFAULT CHARSET=utf8mb4;

