CREATE TABLE `picking_order_details` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `slip_id` int(10) unsigned NOT NULL,
  `product_id` int(10) unsigned NOT NULL,
  `quantity_order` int(10) unsigned NOT NULL,
  `quantity_shipped` int(10) unsigned NOT NULL,
  `location` varchar(45) NOT NULL,
  `stock_id` int(10) unsigned NOT NULL,
  `order_status` varchar(15) NOT NULL,
  `checking_status` varchar(10) NOT NULL,
  `box_number` varchar(15) NOT NULL,
  `box_number_Status` varchar(10) NOT NULL,
  `stock_lotno` varchar(45) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=315 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `product` (
  `product_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `category_id` int(10) unsigned NOT NULL,
  `unit_id` int(10) unsigned NOT NULL,
  `product_type` varchar(10) NOT NULL,
  `product_code` varchar(45) NOT NULL,
  `product_description` varchar(100) NOT NULL,
  `product_image` varchar(255) NOT NULL DEFAULT '0',
  `product_weight` decimal(8,4) NOT NULL DEFAULT 0.0000,
  `product_length` decimal(8,4) NOT NULL DEFAULT 0.0000,
  `product_width` decimal(8,4) NOT NULL DEFAULT 0.0000,
  `product_height` decimal(8,4) NOT NULL DEFAULT 0.0000,
  `product_expiration` varchar(5) NOT NULL,
  PRIMARY KEY (`product_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1761 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `rak` (
  `rak_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `rak_name` varchar(10) NOT NULL,
  `rak_column` varchar(10) NOT NULL,
  `rak_level` varchar(10) NOT NULL,
  PRIMARY KEY (`rak_id`)
) ENGINE=InnoDB AUTO_INCREMENT=515 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `receiving_report` (
  `report_id` int(11) NOT NULL AUTO_INCREMENT,
  `company_name` varchar(255) NOT NULL,
  `origin` varchar(255) NOT NULL,
  `type` varchar(255) NOT NULL,
  `kind` varchar(255) NOT NULL,
  `no_package` int(11) NOT NULL,
  `control_no` int(11) NOT NULL,
  `remarks` varchar(255) NOT NULL,
  `disposition` varchar(255) NOT NULL,
  `reference` varchar(255) NOT NULL,
  `delivery` datetime NOT NULL DEFAULT current_timestamp(),
  `date_added` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `report_status` int(11) NOT NULL DEFAULT 0,
  `expected_weight` varchar(45) NOT NULL,
  `statuss` varchar(45) NOT NULL,
  PRIMARY KEY (`report_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE `receiving_report_item` (
  `item_id` int(11) NOT NULL AUTO_INCREMENT,
  `report_id` int(11) NOT NULL,
  `item_code` varchar(255) NOT NULL,
  `item_lot` varchar(255) NOT NULL,
  `item_description` varchar(255) NOT NULL,
  `item_expiry_month` varchar(255) NOT NULL,
  `item_expiry_year` int(11) NOT NULL,
  `item_unit` varchar(255) NOT NULL,
  `item_received` int(11) NOT NULL DEFAULT 0,
  `user_fullname` varchar(255) NOT NULL,
  PRIMARY KEY (`item_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE `stock` (
  `stock_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `product_id` int(10) unsigned NOT NULL,
  `location_id` int(10) unsigned NOT NULL,
  `location_type` varchar(45) NOT NULL,
  `stock_lotno` varchar(45) NOT NULL,
  `stock_serialno` varchar(45) NOT NULL,
  `stock_qty` varchar(45) NOT NULL,
  `stock_expiration_date` date NOT NULL,
  `picking_order_id` int(10) unsigned NOT NULL,
  `from_stock_id` int(10) unsigned NOT NULL,
  `box_number` varchar(45) NOT NULL,
  `box_number_Status` varchar(45) NOT NULL,
  PRIMARY KEY (`stock_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2628 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `stock_logs` (
  `log_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `stock_id` int(10) unsigned NOT NULL,
  `log_type` varchar(5) NOT NULL,
  `log_qty` int(10) unsigned NOT NULL,
  `log_reference` varchar(45) NOT NULL,
  `log_notes` varchar(105) NOT NULL,
  `log_transaction_date` date NOT NULL,
  `log_transaction_time` varchar(10) NOT NULL,
  `log_posting_date` date NOT NULL,
  `end_user` varchar(45) NOT NULL,
  `approver` varchar(45) NOT NULL,
  `stock_status` varchar(15) NOT NULL,
  `comments` varchar(255) NOT NULL,
  PRIMARY KEY (`log_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3427 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `transfer_item` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `stock_id` int(10) unsigned NOT NULL,
  `stock_qty_moving` int(10) unsigned NOT NULL,
  `rak_id` int(10) unsigned NOT NULL,
  `transfer_status` varchar(15) NOT NULL,
  `requested_by` int(10) unsigned NOT NULL,
  `date_request` date NOT NULL,
  `new_stock_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;



CREATE TABLE `unit` (
  `unit_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `unit_name` varchar(15) NOT NULL,
  PRIMARY KEY (`unit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `user_account` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_fullname` varchar(45) NOT NULL,
  `user_username` varchar(45) NOT NULL,
  `user_password` varchar(45) NOT NULL,
  `user_usertype` varchar(15) NOT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `user_location` (
  `location_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `location` text DEFAULT NULL,
  `timestamp` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`location_id`),
  UNIQUE KEY `user_id` (`user_id`),
  KEY `no_duplicate` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8mb4;

COMMIT;